import "./TaskItem.css";

const TaskItem = (props) => {
  return (
    <div className="task-container">
      <div className="task-item">
        <input type="checkbox" id={props.id + ""}/>
        <label htmlFor={props.id + ""}>{props.todo}</label>
      <div className="delete-task"></div>
      </div>
    </div>
  );
};

export default TaskItem;
